// Example for "DOWHILE" loop
package practice;

public class ExampleOneDoWhile {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x = 10;

	      do {
	    	  System.out.print("value of x : " + x );
	          x++;
	          System.out.print("\n");
	          }while( x < 20 );
	}

}
